import React, { useEffect } from 'react';
import '../styles/components.css';

const Resume = () => {

  useEffect(() => {
    // Function to handle bidirectional chart-legend interactions
    const setupChartInteractions = () => {
      const legendItems = document.querySelectorAll('.legend-item');
      const chartSegments = document.querySelectorAll('.chart-segment');

      // Create a tooltip element for displaying percentages
      const tooltip = document.createElement('div');
      tooltip.className = 'chart-tooltip';
      document.body.appendChild(tooltip);

      // Function to highlight a segment and its legend
      const highlightSegment = (segmentClass, percentage) => {
        // Find the segment and its corresponding legend item
        const segment = document.querySelector(`.chart-segment.segment-${segmentClass}`);
        const legendItem = document.querySelector(`.legend-color.${segmentClass}`).parentElement;

        if (segment && legendItem) {
          // Highlight the segment and legend
          segment.classList.add('segment-highlighted');
          legendItem.classList.add('active');

          // Hide other segments (reverse of previous behavior)
          document.querySelectorAll('.chart-segment').forEach(otherSegment => {
            if (otherSegment !== segment) {
              otherSegment.classList.add('segment-dimmed');
            }
          });

          // Dim other legend items
          document.querySelectorAll('.legend-item').forEach(otherItem => {
            if (otherItem !== legendItem) {
              otherItem.classList.add('legend-dimmed');
            }
          });

          // Show percentage tooltip if provided
          if (percentage) {
            const rect = segment.getBoundingClientRect();
            const svgRect = segment.ownerSVGElement.getBoundingClientRect();

            tooltip.textContent = percentage;
            tooltip.style.display = 'block';
            tooltip.style.left = (svgRect.left + svgRect.width/2) + 'px';
            tooltip.style.top = (svgRect.top + svgRect.height/2) + 'px';
          }
        }
      };

      // Function to reset highlights
      const resetHighlights = () => {
        document.querySelectorAll('.chart-segment').forEach(segment => {
          segment.classList.remove('segment-highlighted');
          segment.classList.remove('segment-dimmed');
        });

        document.querySelectorAll('.legend-item').forEach(item => {
          item.classList.remove('active');
          item.classList.remove('legend-dimmed');
        });

        tooltip.style.display = 'none';
      };

      // Set up legend item interactions
      legendItems.forEach(item => {
        const colorSpan = item.querySelector('.legend-color');
        if (!colorSpan) return;

        const segmentClass = Array.from(colorSpan.classList)
          .find(cls => cls !== 'legend-color');

        if (!segmentClass) return;

        // Get percentage from the corresponding segment
        const segment = document.querySelector(`.chart-segment.segment-${segmentClass}`);
        const percentage = segment ? segment.getAttribute('data-percentage') : null;

        item.addEventListener('mouseenter', () => {
          highlightSegment(segmentClass, percentage);
        });

        item.addEventListener('mouseleave', resetHighlights);
      });

      // Set up chart segment interactions
      chartSegments.forEach(segment => {
        const segmentClasses = Array.from(segment.classList);
        const segmentClass = segmentClasses.find(cls => cls.startsWith('segment-'))?.replace('segment-', '');

        if (!segmentClass) return;

        const percentage = segment.getAttribute('data-percentage');

        segment.addEventListener('mouseenter', () => {
          highlightSegment(segmentClass, percentage);
        });

        segment.addEventListener('mouseleave', resetHighlights);
      });
    };

    // Call the setup function after a short delay to ensure DOM is fully loaded
    const timer = setTimeout(() => {
      setupChartInteractions();
    }, 500);

    // Cleanup function
